「羅漢果顆粒」は、甘くておいしい羅漢果(ラカンカ)茶がすぐ飲める顆粒タイプの羅漢果です。<br>商品の味と品質にとことんこだわり、原料の羅漢果果実も全収穫量の約15%しか収穫できない厳選されたL玉のみを使用。<br>自然の恵みに感謝し丹念に手作業で、一つ一つ心をこめて製造しました。砂糖代わりにも使えます。<br><br>※「らかんか」ひらがな表記のパッケージとなります。<br><br><br>■お召し上がり方<br>1.カップにスプーン4杯以上入れ、お湯を注ぐだけで簡単に甘くて美味しい羅漢果茶が出来ます。<br>2.濃い目の羅漢果茶をつくって、牛乳、ココア、紅茶、黒酢、リンゴ酢、レモン、しょうが汁などを入れてもおいしいです。<br>3.砂糖の代わりにお料理に使用する場合は水から羅漢果顆粒を入れ煮ると、煮崩れせず、素材の味を引き出します。<br>(水200ccに小さじ1杯を目安。この時には甘さは出ませんが、加熱後に加えた時は本来の甘さがでます。)<br><br>※羅漢果顆粒は自然食品です。1日3-10杯を目安に皆様で楽しんでお召し上がり下さい。<br><br><table width=400 border=0 cellpadding=10 cellspacing=2 bgcolor=#555555><tr><th width=150 bgcolor=#DDDDDD>商品名</th><td width=250 bgcolor=#FFFFFF>羅漢果顆粒<br></td></tr><tr><th bgcolor=#DDDDDD>名称</th><td bgcolor=#FFFFFF>らかんか顆粒<br></td></tr><tr><th bgcolor=#DDDDDD>内容量</th><td bgcolor=#FFFFFF>500ｇ×6袋<br></td></tr><tr><th bgcolor=#DDDDDD>原材料</th><td bgcolor=#FFFFFF>羅漢果98%、てんさい糖2%<br></td></tr><tr><th bgcolor=#DDDDDD>保存方法</th><td bgcolor=#FFFFFF>直射日光、高温多湿を避けて保存して下さい。<br></td></tr><tr><th bgcolor=#DDDDDD>賞味期限</th><td bgcolor=#FFFFFF>商品パッケージに記載<br></td></tr><tr><th bgcolor=#DDDDDD>メーカー・製造</th><td bgcolor=#FFFFFF>株式会社らかんかこうぼう(TEL:0525218269)<br></td></tr><tr><th bgcolor=#DDDDDD>区分</th><td bgcolor=#FFFFFF>日本製・健康食品<br></td></tr><tr><th bgcolor=#DDDDDD>広告文責</th><td bgcolor=#FFFFFF>Cheeky株式会社（TEL:0358307901）</td></tr></table><br><br> <font color=red>※商品画像につきまして、カラーはブラウザや設定により実物とは若干異なる場合がございます。<br>また、メーカー様の都合により予告なくパッケージが変更となる可能性があります。<br>あらかじめご了承くださいますようよろしくお願い致します。</font><br><br><font size=1>【検索用】
しかもSOD酵素、ビタミンC、水溶性の植物繊維、ミネラルをバランスよく含んでいます。 らかんか顆粒 単品 ラカンカ 甘味料 砂糖 健康食品 サプリメント 粉末 手軽 通販 安い お得 人気 ランキング 低カロリー ヘルシー 健康 自然 安心 安全 飲み物 毎日 継続 健康維持 コーヒー 紅茶 お茶 牛乳 りんご酢 レモン ココア 水 トッピング 糖質制限 ダイエット カロリーオフ 贈り物 ギフト 父親 母親 祖母 祖父 父の日 母の日 キッチン雑貨 キッチン用品 食品 豆乳 ナチュラル 高濃度 ミネラル 羅漢果顆粒 500g らかんか顆粒 6袋セット </font><br><style type="text/css">
